  \"A class III archaeological survey of twelve region wide fencing upgrade locations
  in Eagle, Grand, Gunnison, Jackson, Moffat, Pitkin, and Routt counties, Colorado\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:42.098349\",\n\t\"name\": \"a-class-iii-archaeological-survey-of-twelve-region-wide-fencing-upgrade-locations-in-eagle\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Colorado Department of Transportation
  proposes to upgrade existing right-of-way fencing along roadways at twelve separate
  locations in northwestern Colorado. To this end, a Class III cultural resource inventory
  was conducted by Centennial Archaeology, Inc. The project covered 37.8 linear miles
  of which 5.1 is federal land and 32.7 is state land. Total project survey acreage
  was 249 (200.13 state and 48.87 federal). The survey resulted in the recording of
  one prehistoric isolated find and six historic sites, In addition, four previously
  recorded prehistoric sites, and one previously recorded historic site were visited
  and reevaluated. Site SEA 1689 is an isolated find and does not require protection.
  Sites 5GF2798.1, 5GF2799.1, 5PT889.1, 5PT890.1, and 5RT1397.1 are segments of irrigation
  ditches that are assessed as not eligible to the National Register of Historic Places
  (NRHP). Site 5RT1396.1 is a segment of the Denver and Rio Grande Western Railroad
  that is assessed as a contributing element of the larger NRHP-eligible site. It
  will not be adversely impacted by fencing operations. The same is true for site
  5GA686.14 - a contributing segment of the NRHP-eligible old US 40 (Victory Highway).
  Previously recorded prehistoric sites 5GA1275/5 JA687,5MF448, and 5MF449 have been
  destroyed and therefore will not be affected by construction. Previously recorded
  prehistoric site 5MF447 has the potential for subsurface cultural remains and therefore
  should be monitored by an archaeologist during fence construction. It is recommended
  that cultural resource clearance be granted so that CDOT Project No. C R300-071
  can proceed, with the single stipulation that monitoring be conducted at 5MF447.\",\n\t\"license_title\":
